/*
 *  Vu_getValue - Vu_setValue
 *
 *  Permet de gérer la compatibilité mobile pour les get/setValue de GreaseMonkey
 *********************************************************************************/        
function Vu_getValue(key,defaultVal)
{
     try
     {  return GM_getValue(key,defaultVal);    }
     catch( err )
     {  
        return defaultVal;
     }
}
    
function Vu_setValue(key,value)
{
     try
     {  GM_setValue(key,value); }
     catch( err )
     {}
}

