/*
 *  Permet de compacter les nombres
 *
 *  n : passage de la valeur à compresser
 *  return :  variable formatée fonction de sa dimension (Mega, Giga, Tera, Kilo-Tera, les nombres Kilo sont laissés tel quel par convention)
 *********************************************************************************************************************************************/
function compactNumbers(n)
    {
        n = numberWithCommas(n);

        if (n == "NaN") { return n ; }
        if(     /(^-?[0-9]{1,3}\.[0-9]{3}\.[0-9]{3}\.[0-9]{3}\.[0-9]{3}\.[0-9]{3})$/.test(n)) // < 1.000.000.000.000.000.000
        {   
            n=n.replace(/([0-9]{0}\.[0-9]{3}\.[0-9]{3}\.[0-9]{3}\.[0-9]{3}$)/, "KT");
                      n=n.replace(/\./g,",");
        }
        else if(/(^-?[0-9]{1,3}\.[0-9]{3}\.[0-9]{3}\.[0-9]{3}\.[0-9]{3})$/.test(n)) // < 1.000.000.000.000.000
        {   
            n=n.replace(/([0-9]{0}\.[0-9]{3}\.[0-9]{3}\.[0-9]{3}$)/, "T");
                      n=n.replace(/\./g,",");
        }
        else if(/(^-?[0-9]{1,3}\.[0-9]{3}\.[0-9]{3}\.[0-9]{3})$/.test(n)) // < 1.000.000.000.000
        {   
            n=n.replace(/([0-9]{0}\.[0-9]{3}\.[0-9]{3}$)/, "G");
                      n=n.replace(/\./g,",");
        }
        else if(/(^-?[0-9]{1,3}\.[0-9]{3}\.[0-9]{3}$)/.test(n))  // < 1.000.000.000
        {
            n=n.replace(/([0-9]{0}\.[0-9]{3}$)/, "M");
                      n=n.replace(/\./g,",");
        }   
       /* else if(/(^-?[0-9]{1,3}\.[0-9]{3}$)/.test(n)) // < 1.000.000
        {
            n=n.replace(/([0-9]{2}$)/, "K");
        }   */    
        

        return n;
}

/*
 *  Permet de compacter les nombres
 *
 *  data : passage de la valeur à traiter
 *  return :  variable formatée sans les séparateurs "."
 ********************************************************/
function parseNumber(data){
 try{
    // 1 ou N chiffres suivi d'un point
    var expression = /([0-9\.]{1,})/g;
    
        if(expression.exec(data)) {
            var value = RegExp.$1;
            value = value.replace(/\./g,"");
            return parseInt(value);
        }
        else {
            return 0;
        }
  }
  catch(err){
    return 0;
  }
}

/*
 *  Permet d'extraire le nom du joueur de la variable
 *
 *  data : passage de la valeur à traiter
 *  return :  nom du joueur extrait de son contexte
 ********************************************************/    
function extractJoueur(data){
 try{
    
    // le caractère espace suivi de caractères lettre (min/maj ou espace) pluieurs fois , insensible à la casse et traite le global
    var expression = /">([a-zA-Z0-9\s]+)<\/span>/ig ; // ancienne version : /&nbsp;([a-zA-Z0-9\s]+) /ig;
    
    if(expression.exec(data)) {
        var value = RegExp.$1;
        return value;
    }
    else {
        return 0;
    }
  }
  catch(err){
    return 0;
  }
}

