    /** Certains select s'affichent fa?on ogame mais avec une largeur de 0px, cette fonction corrige le probl?me
     * en param?tre la fonction prend un objet jQuery contenant 1 ou plusieurs select
     */
    function ogameStyleSelectFix(selects) {
        var ok = false;
        for (var i = 0; i < selects.length; ++i) {
            var select = $(selects[i]);
            var span = select.next();
            if (span.width() === 0) {
                span.remove();
                select.removeClass('dropdownInitialized');
                ok = true;
            }
            select.addClass('fixed');
        }
        if (ok) {
            intercom.send('ogame style');
        }
    }
